import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import IndicadoresList from './components/IndicadoresList';
import AddIndicador from './components/AddIndicador';
import EditIndicador from './components/EditIndicador';

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Gesti√≥n de Indicadores ODS de Salud</h1>
        <Routes>
          <Route path="/" element={<IndicadoresList />} />
          <Route path="/add" element={<AddIndicador />} />
          <Route path="/edit/:id" element={<EditIndicador />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
